import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap-grid.min.css';
import { Col } from 'react-bootstrap';
import './App.css';

axios.defaults.withCredentials = true;

const API_BASE_URL = 'http://localhost:5000';

function NoSessionHome({ sessionActiveArg }) {
  const [sessionActive, setSessionActive] = useState(false);
  setSessionActive(sessionActiveArg);
  const handleNewSessionClick = async () => {
    try {
      await axios.get(`${API_BASE_URL}/sessions/create`);

    } catch (error) {
      console.error('Error creating new session:', error);
    }
  };

  return (
    <>
      <Col className="col-md-12">
        <p>Welcome! No user ID in the session.</p>
        <button className="button create" onClick={handleNewSessionClick}>
          Create session
        </button>
      </Col>
    </>
  );
}

export default NoSessionHome;
